import { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
export default function Form() {
 
  // States for registration
  const [username, setUsername] = useState('');
  const [name, setName] = useState('');
  const [surname, setSurname] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [repeatPassword, setRepeatPassword] = useState('');
  const navigateTo = useNavigate();
 
  // States for checking the errors
  const [submitted, setSubmitted] = useState(false);
  const [error, setError] = useState(false);
  const [selectedItem, setSelectedItem] = useState("")

 
  // Handling the name change
 
  // Handling the form submission
  const handleSubmit = async (e) => {
    console.log(e);
    if (name === '' || username === '' ||surname === ''|| email === '' || password === '') {
      setError(true);
        return
    } 
        
        else {
      setError(false);
      try {
        await axios.post(`${import.meta.env.VITE_API}/register`, e, { withCredentials: true });
        navigateTo('/');
    } catch(err) {
        console.log(err)
    }
    }
  };
 
  // Showing success message
  const successMessage = () => {
    return (
      <div
        className="success"
        style={{
          display: submitted ? '' : 'none',
        }}>
        <h1>User {name} successfully registered!!</h1>
      </div>
    );
  };
 
  
  // Showing error message if error is true
  const errorMessage = () => {
    return (
      <div
        className="error"
        style={{
          display: error ? '' : 'none',
        }}>
        <p style = {{color:"red"}}>Nešto ne valja! Pokušajte ponovno</p>
      </div>
    );
  };
 
  return (
    <div className='form'>
    <div className="p-3 my-5 d-flex flex-column w-50"  item container direction="row"style={{
        position: 'absolute', left: '50%', top: '55%',
        transform: 'translate(-50%, -50%)',
        border: '10px solid rgba(255, 165, 0, 0.5)',
        padding: '20px'
        }}>
    <p style= { { fontSize: 15 }}> Registracija</p>
 
      {/* Calling to the methods */}
 
      <form onSubmit={handleSubmit(handleSubmit)}>
        {/* Labels and inputs for form data */}
        <label className="label">Korisničko ime</label>
        <br/>
        <input className="input"
          value={username} type="text" name = "username" />
        <br/> <br/> 
        <label className="label">Ime</label>
        <br/>
        <input className="input"
          value={name} type="text" name = 'name' />
        <br/> <br/> 
        <label className="label">Prezime</label>
        <br/>
        <input className="input"
          value={surname} type="text" name = 'surname' />
        <br/> <br/> 
        <label className="label">Email</label>
        <br/>
        <input className="input"
          value={email} type="email" name = 'email'/>
        <br/><br/>
        <label className="label">Lozinka</label>
        <br/>
        <input className="input"
          value={password} type="password" name='password'/>
        <br/><br/>
        <label className="label">Ponovite lozinku</label>
        <br/>
        <input className="input"
          value={repeatPassword} type="password" name='repeatPassword' />
        <br/><br/>
        <label className="label">Grad</label>
        <br/>
        <select name='town' value={selectedItem}>
        <option value="Counter">Counter</option>
        <option value="useEffect">useEffect</option>
      </select>
        <br/><br/>
        <button  className="btn" type="submit">
          Submit
        </button>
      </form>
    </div>
    <div className="messages" style={{
        position: 'absolute', left: '50%', top: '12%',
        transform: 'translate(-50%, -50%)'}}>
        {errorMessage()}
      </div>
    </div>
  );
}
